import React, { use } from 'react';

import Header from './Header';
import { useState } from 'react';

function App() {
  const [counter, setCounter] = useState(1);
  function increment(){
    setCounter(counter++);
  }
  
  return (
    <div>
    <Header>Contador: {counter}</Header>
    <button onClick={increment}>Incrementar</button>
    </div>
  );
}

export default App;
